import product1 from "./assets/products/1.png";
import product2 from "./assets/products/2.png";
import product3 from "./assets/products/3.png";
import product4 from "./assets/products/4.webp";
import product5 from "./assets/products/5.png";
import product6 from "./assets/products/6.png";
import product7 from "./assets/products/7.webp";
import product8 from "./assets/products/8.webp";
import product9 from "./assets/products/9.jpg";
import product10 from "./assets/products/10.jpg";
import product11 from "./assets/products/11.jpg";

const PRODUCTS = Array.from({length: 11}, (_, i) => ({
  id: i + 1,
  productName: "hola",
  price: 19.99,
  productImage: require(`./assets/products/${i + 1}.${i < 3 || (i > 4 && i < 6) ? 'png' : i === 3 || i === 6 ? 'webp' : 'jpg'}`).default,
}));
